import styled from "styled-components";
import Container from "../../../Layout/Container";
import HorizontalLine from "../../HorizontalLine";
import Header from "../Header";
import Table from "./Table";

import MarginBlock from "../../../Layout/MarginBlock";

const StyledRooms = styled.div`
  width: 75%;
`;

const Rooms = ({}) => {
  const dataPrimary = [
    {
      data: "Players",
    },
    {
      data: "Mode",
    },
    {
      data: "User",
    },
    {
      data: "Message",
    },
    {
      data: "Join",
    },
  ];

  const rowsData = [
    [
      {
        data: "Players",
      },
      {
        data: "Mode",
      },
      {
        data: "User",
      },
      {
        data: "Message",
      },
      {
        data: "Join",
      },
    ],
    [
      {
        data: "Players",
      },
      {
        data: "Mode",
      },
      {
        data: "User",
      },
      {
        data: "Message",
      },
      {
        button: true,
        data: "Join",
      },
    ],
  ];

  return (
    <StyledRooms>
      <Header>
        <p
          style={{
            fontSize: "16px",
            fontWeight: 700,
            letterSpacing: "2px",
            marginLeft: "22px",
          }}
        >
          ACTIVE GAMES (4)
        </p>
      </Header>
      <Container width="80%">
        <MarginBlock height="60px"></MarginBlock>
        <Table
          widthCells={[15, 10, 10, 50, 15]}
          dataPrimary={dataPrimary}
          rowsData={rowsData}
        />
      </Container>
    </StyledRooms>
  );
};

export default Rooms;
